import React from "react";
import { useState } from "react";

const useCountALL = (companyData: any) => {
  const [totalPros1, setTotalPros1] = useState(0);

  companyData?.map((item: any) => {
    const countArray: number[] = [];
    console.log(item);
    console.log("item.pros1:", item.pros1);
    countArray.push(item.pros1);
    console.log("길이가 2여야됑..", countArray.length);
    console.log("난 prosArray얌", countArray);
    let pros1TotalResult: number = countArray.reduce(
      (total: number, value: number) => (total += value),
      0
    );
    console.log("result가 2가 나와야댕 : ", pros1TotalResult);
    setTotalPros1(pros1TotalResult);
  });
  return { totalPros1 };
};

export default useCountALL;
